                @success="loadBlocks('refresh'); defrostTimes = []; getDefrostTime(); balloonBlocks = []; blockInBalloon();"
                @loading="setBuyLoading"
                @isThrowing="setThrowing"
                @error="setError"
                @close="isBuyModalVisible = false"/>
    </transition>
