</template>

<script>
import AppHeader from "../components/AppHeader";
import contract from "../api/contract";
import AboutModal from "../components/Modals/AboutModal";
import Preloader from "../components/Preloader";
import {mapGetters} from "vuex";
import BuyModal from "../components/Modals/BuyModal";
import ErrorModal from "../components/Modals/ErrorModal";
import InfoModal from "../components/Modals/InfoModal";

export default {
  name: 'Home',
  components: {
    ErrorModal,
    AppHeader,
    AboutModal,
    Preloader,
    BuyModal,
    InfoModal,
  },
  props: {
    owner: {
      type: String,
      required: false
    }
  },
  data() {
    return {
      error: null,
      showScrollBottomButton: true,
      isNetworkBtnVisible: false,
      errorModalTitle: null,
      mode: null,
      loading: false,
      isMoveDown: false,
      isMoveUp: false,
      isThrowing: false,
      blocksQt: 64,
      page: 0,
      blockNumber: null,
      blockOwner: null,
      isAboutModalVisible: false,
      isBuyModalVisible: false,
      isHighlight: !!localStorage.getItem('isHighlight'),
      towerBlocksExtraLarge: [],
      towerBlocksMiddleLarge: [],
      towerBlocksLg: [],
      towerBlocksMd: [],
      towerBlocksSm: [],
      towerBlocksXs: [],
      defrostTimes: [],
      blocksLoaded: 63,
      balloonBlocks: [],
      rows: [],
      lastBlockId: 0,
      isCraneBlockInfoVisible: false,
      isBalloonBlocksInfoVisible: false,
      loadMore: false,
      disableLoading: false,
      sectionPortion: 0,
    //  movePoint: false,
    }
  },
  computed: {
    ...mapGetters({
      getAccount: 'wallet/getAccount',
      isWrongChainId: 'wallet/isWrongChainId'
    }),

  },
  watch: {
    isWrongChainId(val) {
      if (val) {
        this.error = 'Looks like you connected to unsupported network. Change network to Binance Smart Chain.'
        this.isNetworkBtnVisible = true;
        this.errorModalTitle = 'Wrong network'
      } else {
        this.error = null;
        //this.init();
      }
    }
  },
  methods: {
    getFrostTime(time, index) {
      let date = new Date();
      return Number(date.setSeconds(date.getSeconds() + Number(this.defrostTimes[index])));
    },
    setError(err) {
      this.error = err;
    },
    setHighlight() {
      if (this.isHighlight) {
        localStorage.removeItem('isHighlight');
      } else {
        localStorage.setItem('isHighlight', 'true')
      }
      this.isHighlight = !this.isHighlight;
    },
    handlePageScroll() {
      window.addEventListener('scroll', () => {
        this.showScrollBottomButton = (window.innerHeight + window.scrollY) < document.body.offsetHeight;
      })
    },
    scrollToEnd() {
      window.scrollTo({
        top: document.body.scrollHeight || document.documentElement.scrollHeight,
        behavior: 'smooth'
      });
    },
    validate(config) {
      if (!this.getAccount) {
        this.error = 'Connect your web3 wallet';
        return false;
      }
      if (this.isWrongChainId) {
        this.error = 'Wrong network (Looks like you connected to unsupported network. Change network to Binance Smart Chain).'
        return false;
      }
      if (config.mode && config.mode === 'update' && config.owner !== this.getAccount) {
        this.error = 'You are not the owner of this block';
        return false;
      }
      return true;
    },
    // eslint-disable-next-line no-unused-vars
    transitionBeforeEnter(el) {
      el.style.opacity = 0;
    },
    // eslint-disable-next-line no-unused-vars
    transitionLeave(el, done) {
      const delay = el.dataset.index * 350
      el.style.display = "none";
      setTimeout(() => {
        el.style.opacity = 0;
      }, delay)
    },
    // eslint-disable-next-line no-unused-vars
    transitionEnter(el, done) {
      //const delay = el.dataset.index * 150
      setTimeout(() => {
        el.style.transition = '0.5s'
        el.style.opacity = 1;
      }, 0)
    },
    generateCover() {
      return `/img/cover-${Math.floor(Math.random() * (10 - 2 + 1) + 2)}.png`
    },
    setBuyLoading(status) {
      this.loading = status;
    },
    setThrowing(status) {
      this.isThrowing = status;
    },
    openBuyModal(mode, blockNumber, owner) {
      if (!this.validate({mode, owner})) {
        return
      }
      this.mode = mode;
      this.blockNumber = blockNumber;
      this.blockOwner = owner;
      this.isBuyModalVisible = true;
    },
    scrollToTop() {
      window.scroll({top: 0, left: 0, behavior: 'smooth'});
    },
    isOwnerBlock(address) {
      return !!(this.getAccount && this.isHighlight && this.getAccount === address);
    },
    async getDefrostTime() {
      try {
        let time = await contract.getDefrostTime(this.defrostTimes.length + 1);
        this.defrostTimes.push(time);
      } catch (e) {
        this.defrostTimes.push(0);
      } finally {
        if (this.defrostTimes.length < 4) {
          await this.getDefrostTime();
        }
      }
    },
    async blockInBalloon() {
      try {
        while (this.balloonBlocks.length !== 4) {
          let block = await contract.blockInBalloon(this.balloonBlocks.length + 1);
          this.balloonBlocks.push(block)
        }
      } catch (e) {
        console.log(e);
        this.blockInBalloon();
      }
    },
    fillArrays() {
      this.towerBlocksExtraLarge = [];
      this.towerBlocksMiddleLarge = [];
      this.towerBlocksLg = [];
      this.towerBlocksMd = [];
      this.towerBlocksSm = [];
      this.towerBlocksXs = [];
      const el = {
        description: null,
        owner: null,
        imageUrl: require('@/assets/img/loading.gif'),
        cover: null,
        showHover: false
      }
      el.cover = '/img/cover-1.png';
      this.towerBlocksExtraLarge.push(el)
      for (let i = 0; i < 2; i++) {
        el.cover = this.generateCover();
        this.towerBlocksMiddleLarge.push(Object.assign({}, el))
      }
      for (let i = 0; i < 4; i++) {
        el.cover = this.generateCover();
        this.towerBlocksLg.push(Object.assign({}, el))
      }
      for (let i = 0; i < 8; i++) {
        this.towerBlocksMd.push(Object.assign({}, el))
      }
      for (let i = 0; i < 16; i++) {
        this.towerBlocksSm.push(Object.assign({}, el))
      }
      for (let i = 0; i < 16; i++) {
        this.towerBlocksXs.push(Object.assign({}, el))
      }
    },
    fillFooter() {
      let rowsIndexes = [];
      const el = {
        description: null,
        owner: null,
        imageUrl: require('@/assets/img/loading.gif'),
        cover: this.generateCover(),
        showHover: false,
      }
      let part = new Array(16).fill().map(() => Object.assign({}, el));
      let rows = Math.ceil((this.lastBlockId - this.blocksLoaded) / 16);
      if(rows > 10) {
        rows = 10;
      } else {
        this.loadMore = true;
      }
      for (let i = 0; i < rows; i++) {
        this.rows.push({
          foundation: JSON.parse(JSON.stringify(part))
        });
        rowsIndexes.push(this.rows.length - 1);
      }

      if(this.loadMore) {
        for(let i = (this.lastBlockId - this.blocksLoaded) % 16; i < 16; i++) {
          this.rows[this.rows.length - 1].foundation[i].imageUrl = null;
        }
      }

      return rowsIndexes
    },
    async calcBlocks() {
      this.lastBlockId = await contract.lastBlockNumber()
      this.lastBlockId = parseInt(this.lastBlockId);
    },
    async loadBlocks(refresh) {
      if(refresh === 'refresh') {

        await this.calcBlocks()
        this.page = 0;
        this.blocksLoaded = 63;
        this.rows = [];
        this.loadMore = false;
      }
      this.sectionPortion = 0;
      let lastBlockId = this.lastBlockId;
      if (this.page === 0) {
        await this.fillArrays();
        let iterationsCount = 0;
        let extraLargeCount = 0;
        let middleLargeCount = 0;
        let largeCount = 0;
        let middleCount = 0;
        let smallCount = 0;
        let extraSmallCount = 0;
        if (this.owner) {
          let i = lastBlockId;
          // eslint-disable-next-line no-constant-condition
          while (true) {
            let block = await contract.blockOfNumber(i);
            if (this.owner && block.owner !== this.getAccount) {
              i--;
              continue;
            }
            i--;
            this.blocksLoaded++;
            iterationsCount++;
            if (iterationsCount === 1) {
              this.towerBlocksExtraLarge[extraLargeCount].imageUrl = block.imageUrl;
              this.towerBlocksExtraLarge[extraLargeCount].description = block.description;
              this.towerBlocksExtraLarge[extraLargeCount].owner = block.owner;
              this.towerBlocksExtraLarge[extraLargeCount].number = block.number;
            } else if (iterationsCount > 1 && iterationsCount < 4) {
              this.towerBlocksMiddleLarge[middleLargeCount].imageUrl = block.imageUrl;
              this.towerBlocksMiddleLarge[middleLargeCount].description = block.description;
              this.towerBlocksMiddleLarge[middleLargeCount].owner = block.owner;
              this.towerBlocksMiddleLarge[middleLargeCount].number = block.number;
              middleLargeCount++;
            } else if (iterationsCount >= 4 && iterationsCount < 8) {
              this.towerBlocksLg[largeCount].imageUrl = block.imageUrl;
              this.towerBlocksLg[largeCount].description = block.description;
              this.towerBlocksLg[largeCount].owner = block.owner;
              this.towerBlocksLg[largeCount].number = block.number;
              largeCount++;
            } else if (iterationsCount >= 8 && iterationsCount < 16) {
              this.towerBlocksMd[middleCount].imageUrl = block.imageUrl;
              this.towerBlocksMd[middleCount].description = block.description;
              this.towerBlocksMd[middleCount].owner = block.owner;
              this.towerBlocksMd[middleCount].number = block.number;
              middleCount++;
            } else if (iterationsCount >= 16 && iterationsCount < 32) {
              this.towerBlocksSm[smallCount].imageUrl = block.imageUrl;
              this.towerBlocksSm[smallCount].description = block.description;
              this.towerBlocksSm[smallCount].owner = block.owner;
              this.towerBlocksSm[smallCount].number = block.number;
              smallCount++;
            } else if (iterationsCount >= 32 && iterationsCount < 64) {
              this.towerBlocksXs[extraSmallCount].imageUrl = block.imageUrl;
              this.towerBlocksXs[extraSmallCount].description = block.description;
              this.towerBlocksXs[extraSmallCount].owner = block.owner;
              this.towerBlocksXs[extraSmallCount].number = block.number;
              extraSmallCount++;
            }
            if (i < 1 || this.towerBlocksSm[this.towerBlocksSm.length - 1].owner) {
              break;
            }
          }
        } else {
          this.loadMainTowerPart(0, lastBlockId)
          this.loadMainTowerPart(1, lastBlockId)
          this.loadMainTowerPart(2, lastBlockId)
          this.loadMainTowerPart(3, lastBlockId)
          this.loadMainTowerPart(4, lastBlockId)
          this.loadMainTowerPart(5, lastBlockId)
        }
        if (lastBlockId <= this.blocksQt) {

          return;
        }
        this.page++;
      } else {
        if (lastBlockId <= this.blocksQt) {
          this.loadMore = false;
          return;
        }
        let blocksLeft = lastBlockId - this.blocksLoaded;
        let rowsIndexes = this.fillFooter();
        this.blocksLoaded += 160;
        let index = 0;
        for (let i = 0; i < rowsIndexes.length; i++) {
          if (blocksLeft - 15 <= 0) {
            this.loadRow(blocksLeft, 1, rowsIndexes[index]);
            return
          }
          this.loadRow(blocksLeft, blocksLeft - 15, rowsIndexes[index]);
          blocksLeft -= 16;
          index++;
        }
        this.page++;
      }
    },
    async loadMainTowerPart(row, lastBlockId) {
      let block = null;
      let index = 0;
      switch (row) {
        case 0:
          if(lastBlockId <= 0) {
            this.towerBlocksExtraLarge.forEach(i => i.imageUrl = null);
            this.towerBlocksMiddleLarge.forEach(i => i.imageUrl = null);
            this.towerBlocksLg.forEach(i => i.imageUrl = null);
            this.towerBlocksMd.forEach(i => i.imageUrl = null);
            this.towerBlocksSm.forEach(i => i.imageUrl = null);
            this.towerBlocksXs.forEach(i => i.imageUrl = null);
            this.loadMore = true;
            return
          }
          try {
            block = await contract.blockOfNumber(lastBlockId);
          } catch (e) {
            console.log(e);
            this.loadMainTowerPart(row, lastBlockId);
          }
          this.towerBlocksExtraLarge[0].imageUrl = block.imageUrl;
          this.towerBlocksExtraLarge[0].description = block.description;
          this.towerBlocksExtraLarge[0].owner = block.owner;
          this.towerBlocksExtraLarge[0].number = block.number;
          break;
        case 1:
          if(lastBlockId <= 1) {
            this.towerBlocksMiddleLarge.forEach(i => i.imageUrl = null);
            this.towerBlocksLg.forEach(i => i.imageUrl = null);
            this.towerBlocksMd.forEach(i => i.imageUrl = null);
            this.towerBlocksSm.forEach(i => i.imageUrl = null);
            this.towerBlocksXs.forEach(i => i.imageUrl = null);
            this.loadMore = true;
            return
          }
          for (let i = lastBlockId - 1; i >= lastBlockId - 2; i--) {
            try {
              block = await contract.blockOfNumber(i);
            } catch (e) {
              console.log(e);
              this.loadMainTowerPart(row, lastBlockId);
            }
            this.towerBlocksMiddleLarge[index].imageUrl = block.imageUrl;
            this.towerBlocksMiddleLarge[index].description = block.description;
            this.towerBlocksMiddleLarge[index].owner = block.owner;
            this.towerBlocksMiddleLarge[index].number = block.number;
            index++;
          }
          break;
        case 2:
          if(lastBlockId <= 3) {
            this.towerBlocksLg.forEach(i => i.imageUrl = null);
            this.towerBlocksMd.forEach(i => i.imageUrl = null);
            this.towerBlocksSm.forEach(i => i.imageUrl = null);
            this.towerBlocksXs.forEach(i => i.imageUrl = null);
            this.loadMore = true;
            return
          }
          for (let i = lastBlockId - 3; i >= lastBlockId - 6; i--) {
            try {
              block = await contract.blockOfNumber(i);
            } catch (e) {
              console.log(e);
              this.loadMainTowerPart(row, lastBlockId);
            }
            this.towerBlocksLg[index].imageUrl = block.imageUrl;
            this.towerBlocksLg[index].description = block.description;
            this.towerBlocksLg[index].owner = block.owner;
            this.towerBlocksLg[index].number = block.number;
            index++;
          }
          break;
        case 3:
          if(lastBlockId <= 7) {
            this.towerBlocksMd.forEach(i => i.imageUrl = null);
            this.towerBlocksSm.forEach(i => i.imageUrl = null);
            this.towerBlocksXs.forEach(i => i.imageUrl = null);
            this.loadMore = true;
            return
          }
          for (let i = lastBlockId - 7; i >= lastBlockId - 14; i--) {
            try {
              block = await contract.blockOfNumber(i);
            } catch (e) {
              console.log(e);
              this.loadMainTowerPart(row, lastBlockId);
            }
            this.towerBlocksMd[index].imageUrl = block.imageUrl;
            this.towerBlocksMd[index].description = block.description;
            this.towerBlocksMd[index].owner = block.owner;
            this.towerBlocksMd[index].number = block.number;
            index++;
          }
          break;
        case 4:
          if(lastBlockId <= 7) {
            this.towerBlocksSm.forEach(i => i.imageUrl = null);
            this.towerBlocksXs.forEach(i => i.imageUrl = null);
            this.loadMore = true;
            return
          }
          for (let i = lastBlockId - 15; i >= lastBlockId - 30; i--) {
            try {
              block = await contract.blockOfNumber(i);
            } catch (e) {
              console.log(e);
              this.loadMainTowerPart(row, lastBlockId);
            }
            this.towerBlocksSm[index].imageUrl = block.imageUrl;
            this.towerBlocksSm[index].description = block.description;
            this.towerBlocksSm[index].owner = block.owner;
            this.towerBlocksSm[index].number = block.number;
            index++;
          }
          break;
        case 5:
          if(lastBlockId <= 15) {
            this.towerBlocksXs.forEach(i => i.imageUrl = null);
            this.loadMore = true;
            return
          }
          for (let i = lastBlockId - 31; i >= lastBlockId - 47; i--) {
            try {
              block = await contract.blockOfNumber(i);
            } catch (e) {
              console.log(e);
              this.loadMainTowerPart(row, lastBlockId);
            }
            this.towerBlocksXs[index].imageUrl = block.imageUrl;
            this.towerBlocksXs[index].description = block.description;
            this.towerBlocksXs[index].owner = block.owner;
            this.towerBlocksXs[index].number = block.number;
            index++;
          }
          break;
      }
    },
    async loadRow(from, to, row) {
      if (to <= 0 || from <= 0) {
        return
      }
      let index = 0;
      for (let i = from; i >= to; i--) {
        let block = null;
        try {
          block = await contract.blockOfNumber(i);
          this.sectionPortion++;
        } catch (e) {
          console.log(e);
          this.loadRow(from, to, row);
        }
        this.rows[row].foundation[index].imageUrl = block.imageUrl;
        this.rows[row].foundation[index].description = block.description;
        this.rows[row].foundation[index].owner = block.owner;
        this.rows[row].foundation[index].number = block.number;
        index++;
      }
    },
    init() {
      this.loading = true;
      setTimeout(() => {
        Promise.all([
          this.calcBlocks(),
          this.getDefrostTime(),
          this.blockInBalloon(),
        ])
          .then(() => {
            this.loadBlocks()
            this.loading = false;
          })
      }, 0);
    }
  },
  filters: {
    cutHash(v) {
      if (v) {
        let valStart = v.substring(0, 6)
        let valEnd = v.substring(v.length - 5, v.length);
        return `${valStart}...${valEnd}`
      } else {
        return ''
      }
    }
  },
  mounted() {
    this.handlePageScroll();
    this.init();

    document.addEventListener('mouseover', () => {
      const blockList = document.body.querySelectorAll('.tower-block');



      for (let i = 0; i < blockList.length; i++) {
        let blockRect = blockList[i].getBoundingClientRect();

        let blockRightX = blockRect.x + blockRect.width;
        //let blockTopY = blockRect.y + blockRect.height;

        /*     let x = e.clientX - blockRect.left;
             let y = e.clientY - blockRect.top;

           blockList[i].style.left = x + 'px';
           blockList[i].style.top = y + 'px';*/


        if (blockRightX > window.outerWidth) {
          blockList[i].classList.add("change");
          blockList[i].style.left = 'unset';
          blockList[i].style.right = '50%';
          ////    this.movePoint = true;

        }
        /*  if (blockTopY > window.outerHeight) {
         //   blockList[i].style.bottom = '0%';
          }*/
      }

    })


  },
}
</script>


